    const [tela1, setTela1] = React.useState(false);
    const [tela2, setTela2] = React.useState(false);
    const [tela3, setTela3] = React.useState(false);
    const [tela4, setTela4] = React.useState(false);
    const [tela5, setTela5] = React.useState(false);

    return (
        <>
            <div className='tela--inicial--tela1'>
                <p className='item' onClick={botaoOpt1} >Correção das Observações do CRLV-E</p>
                <p className='item' onClick={botaoOpt2} >Correção de Chassi</p>
                <p className='item' onClick={botaoOpt3} >Correção de Informações do Proprietário</p>
                <p className='item' onClick={botaoOpt4} >Correção de Informações do Veículo</p>
                <p className='item' onClick={botaoOpt5} >Correção de Município</p>
                <p className='item' onClick={botaoOpt6} >Correção de Restrições</p>
            </div>
            
        </>
    )
}

export default Tela5
